Vue = require("vue")
Vue.config.debug = true
Router = require("/Users/vin/v-ctx-menu/node_modules/vue-router/dist/vue-router.js")
Vue.use(Router)
router = new Router({history:false, hashbang: true})

routes = {
  "/demo": {component: require("./demo.vue")},

}
app = Vue.extend({data: function() {return {availableRoutes: routes}}})
router.map(routes)
router.on("/", {component: require("/Users/vin/v-ctx-menu/node_modules/vue-dev-server/app/main.js")})
router.afterEach(function(transition) {
  document.title = transition.to.path + " - vue-dev-server"
})
router.start(app,"#app")